'use strict'
const net = require('net')

let isWorker = false
try {
  // Skip redirecting stdout in Worker threads.
  isWorker = !require('worker_threads').isMainThread
} catch (e) {}

if (!isWorker) {
  const socket = new net.Socket({
    fd: 3,
    readable: false,
    writable: true
  })
  Object.defineProperty(process, 'stdout', {
    configurable: true,
    enumerable: true,
    get: () => socket
  })
  Object.defineProperty(process.stdout, 'fd', {
    value: socket._handle.fd
  })
}

import http from 'http'
import { app } from './app.js'
import { configureSocket } from '../socket/socketConfig.js';
import { info } from '../config/config.js'

export function createServer(PORT) {
    return new Promise((resolve, reject) => {
        const server = http.createServer(app).listen(PORT, () => {
            configureSocket(server)
            console.log('Server listening on port' + PORT);
            resolve(server)
        }).on('error', error => {
            console.log(`Server error: ${error}`);
            reject(error)
        })

    })
}

